const commonWordset = new Set(commonWords.split(" "));
const uncommonWordset = new Set(uncommonWords.split(" "));

let timer;
let timeLeft = 60;
let currentLetters = "";
let allLetters = [];
let score = 0;
let isGameActive = false;
let validWordRE;

const wordInput = document.getElementById("wordInput");
const submitButton = document.getElementById("submitButton");
const skipButton = document.getElementById("skipButton");
const startButton = document.getElementById("startGame");
const shareButton = document.getElementById("shareButton");
const copiedResults = document.getElementById("copiedResults");
const timerDisplay = document.querySelector(".timer");
const scoreDisplay = document.querySelector(".score");
const licensePlate = document.querySelector(".license-plate");
const wordHistory = document.getElementById("wordHistory");
const gameContainer = document.getElementById("game-container");

// use our own random number generator so we can seed it (Math.random() can't be seeded)
// from https://stackoverflow.com/a/47593316/69721
function splitmix32(a) {
  return function () {
    a |= 0;
    a = (a + 0x9e3779b9) | 0;
    let t = a ^ (a >>> 16);
    t = Math.imul(t, 0x21f0aaad);
    t = t ^ (t >>> 15);
    t = Math.imul(t, 0x735a2d97);
    return ((t = t ^ (t >>> 15)) >>> 0) / 4294967296;
  };
}

function newSeed() {
  return (Math.random() * 2 ** 32) >>> 0;
}

let seed =
  location.hash == "" ? newSeed() : parseInt(location.hash.substring(1), 10);
let random = splitmix32(seed);
location.hash = `#${seed}`;

function generateLicensePlate() {
  let alphabet = Array(26)
    .fill()
    .map((_, i) => String.fromCharCode("A".charCodeAt(0) + i));
  let letters;

  // generate three random letters until we find at least one word containing those letters
  while (true) {
    letters = [...Array(3).keys()].map(
      () => alphabet[Math.floor(random() * 26)]
    );
    // construct a regex to find words that contain these letters in the same order
    validWordRE = new RegExp(`[^\\s]*?${letters.join("[^\\s]*?")}[^\\s]*`, "i");

    if (commonWords.match(validWordRE)) {
      break;
    }
  }

  letters = letters.join("");
  // Generate 3-4 random numbers
  const numlen = Math.floor(3.5 + random());
  const numbers = Math.floor(random() * Math.pow(10, numlen))
    .toString()
    .padStart(numlen, "0");

  return `${letters}-${numbers}`;
}

function updateTimer() {
  timerDisplay.textContent = timeLeft;
  if (timeLeft <= 0) {
    endGame();
  } else {
    timeLeft--;
  }
}

function startGame() {
  if (startButton.innerText == "New Game") {
    let seed = newSeed();
    random = splitmix32(seed);
    location.hash = `#${seed}`;
  }

  isGameActive = true;
  timeLeft = 60;
  score = 0;
  wordHistory.innerHTML = "";
  scoreDisplay.textContent = `Score: ${score}`;

  wordInput.value = "";
  wordInput.disabled = false;
  submitButton.disabled = false;
  skipButton.disabled = false;
  startButton.disabled = true;
  shareButton.style.display = "none";

  showNewPlate();
  wordInput.focus();
  timer = setInterval(updateTimer, 1000);
}

function endGame() {
  clearInterval(timer);
  isGameActive = false;
  wordInput.disabled = true;
  submitButton.disabled = true;
  skipButton.disabled = true;
  startButton.innerText = "New Game";
  startButton.disabled = false;
  shareButton.style.display = "inline-block";
  timerDisplay.textContent = "Game Over!";
}

function showNewPlate() {
  const plate = generateLicensePlate();
  licensePlate.textContent = plate;
  currentLetters = plate.split(" ")[0];
  allLetters.push(currentLetters);
}

function checkWord(word, letters) {
  return (
    word.match(validWordRE) &&
    (commonWordset.has(word.toLowerCase()) ||
      uncommonWordset.has(word.toLowerCase()))
  );
}

function calculatePoints(word) {
  // Shorter words get more points
  return Math.max(20 - word.length * 2, 1);
}

function getValidWords(letters) {
  let allWordsRE = new RegExp(validWordRE.source, "ig");
  let matchingWords = commonWords.match(allWordsRE).concat(uncommonWords.match(allWordsRE));
  matchingWords.sort((a, b) => a.length > b.length);
  return matchingWords;
}

submitButton.addEventListener("click", () => {
  const word = wordInput.value.trim();

  if (!checkWord(word, currentLetters)) {
    // add the "wrong" class to the game-container briefly
    gameContainer.classList.add("wrong");
    setTimeout(() => {
      gameContainer.classList.remove("wrong");
    }, 100);
    wordInput.value = "";
  } else {
    gameContainer.classList.add("correct");
    setTimeout(() => {
      gameContainer.classList.remove("correct");
    }, 100);

    const points = calculatePoints(word);
    score += points;
    scoreDisplay.textContent = `Score: ${score}`;

    // Add to history
    const historyItem = document.createElement("div");
    historyItem.className = "history-item";
    let validWords = getValidWords(currentLetters);
    let helpText =
      validWords[0].length < word.length ? ` - Better: ${validWords[0]}` : "";
    historyItem.textContent = `${currentLetters}: ${word} (+${points} points)${helpText}`;
    wordHistory.insertBefore(historyItem, wordHistory.firstChild);

    // Show new plate
    showNewPlate();
    wordInput.focus();
    wordInput.value = "";
  }
});

skipButton.addEventListener("click", () => {
  let skipPenalty = 1;
  score -= skipPenalty;
  scoreDisplay.textContent = `Score: ${score}`;

  // Add to history
  const historyItem = document.createElement("div");
  historyItem.className = "history-item";
  let validWords = getValidWords(currentLetters);
  let helpText = `Answer(s): ${validWords[0]}${
    validWords.length > 1 ? ` and ${validWords.length - 1} more.` : ""
  }`;
  historyItem.textContent = `${currentLetters}: <SKIP> (-${skipPenalty} points) - ${helpText}`;
  wordHistory.insertBefore(historyItem, wordHistory.firstChild);

  showNewPlate();
  wordInput.focus();
  wordInput.value = "";
});

wordInput.addEventListener("keyup", (e) => {
  switch (e.key) {
    case "Enter":
      submitButton.click();
      break;
    case "Escape":
      skipButton.click();
      break;
  }
});

startButton.addEventListener("click", startGame);

shareButton.addEventListener("click", () => {
  // copy results to clipboard
  const text = `I got ${score} points in License Plate Game! Try it yourself at https://licenseplategame.fun${location.hash}`;
  try {
    navigator.clipboard.writeText(text);
    copiedResults.style.display = "block";
    setTimeout(() => {
      copiedResults.style.display = "none";
    }, 3000);
  } catch (error) {
    console.error(error.message);
  }
});
